import com.eviware.soapui.support.XmlHolder

def xml= new XmlHolder(mockRequest.requestContent)

def request= xml["//typ:guestName"]

def response

if(request.equals("IT"))
{
	response="IT"
}
else if(request.equals("Finance"))
{
	response="Finance"
}
else if(request.equals("Management"))
{
	response="Management"

}
else
{
	response="HR"
}
return response
